import React, {useState, useEffect} from 'react';
import './App.css';
import '@picocss/pico';
// import axios from "axios";


function App() {

  let [weaponImage, setWeaponImage] = useState(null);

  useEffect(() => {
    fetch("http://csgobackpack.net/api/GetItemsList/v2/", {mode: "cors"}) 
    .then(response => response.json())
    .then(data => setWeaponImage(data.message))
  }, [])

  // useEffect(() => {
  //   axios.get("http://csgobackpack.net/api/GetItemsList/v2/", { mode: "cors" })
  //     .then(response => {
  //       const data = response.data;
  //       setWeaponImage(data.message);
  //     })
  //     .catch(error => {
  //       console.error("Error:", error);
  //       // Handle any errors that occurred during the request
  //     });
  // }, []);

  return (
    <div>
      {weaponImage && <img src={weaponImage}></img>}
    </div>
  );
}

export default App;
